import { CardContainer, HeadingContainer, Heading, CardImage } from './ProjectCard.styles'

const ProjectCard = props => {
  return (
    <CardContainer>
    <HeadingContainer>
    <Heading />
    <CardImage src={props.source} />
    </HeadingContainer>

    </CardContainer>
  )
}

export { ProjectCard }
